  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:50.034891\",\n\t\"name\": \"environmental-covariate-rasters-for-the-western-u-s\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Each set of these three sets of rasters
  cover the Western 11 conterminous U.S. states. They share the same extent, cell
  size, and projection so that they can easily be used in species distribution modeling.
  Each of the zipped folders below contains the same set of 25 environmental covariate
  rasters, but at different resolutions. Note that the higher resolution data sets
  are much bulkier - the 90m set is 4GB when zipped. See the metadata spreadsheet
  (included in the zipped folder for each resolution) for full details on what each
  layer represents, where it was obtained, and how it was processed. The following
  25 variables are included: Mean annual temperature; Annual precipitation; Precipitation
  of the warmest quarter (JUN-JUL-AUG); Precipitation of the coldest quarter (DEC-JAN-FEB);
  Mean temperature of the warmest quarter (JUN-JUL-AUG); Mean temperature of the coldest
  quarter (DEC-JAN-FEB); Max temperature of the warmest month (JUL); Minimum temperature
  of the coldest month (DEC); Temperature annual range (TMax JUL - TMin DEC); Temperature
  Seasonality (standard deviation *100); Precipitation Seasonality (Coefficient of
  Variation); Mean Climatic Water Deficit; Actual Evapotranspiration (AET); Topsoil
  Sand Fraction (0-30cm); Topsoil Silt Fraction (0-30cm); Topsoil Clay Fraction (0-30cm);
  Topsoil Bulk Density (0-30cm); Topsoil pH (0-30cm); Slope; Aspect; Compound Topographic
  Index (CTI); Percent natural within 1 km; Crosswalked LANDFIRE Existing Vegetation
  Type; Distance to permanent water; and Growing Degree Days.\",\n\t\"license_title\":
